{% block scripts %}
   <script>
      document.addEventListener("DOMContentLoaded", function() {
         // Seleccionamos todos los elementos que tengan data-bs-toggle="popover"
         const popoverTriggerList = document.querySelectorAll('[data-bs-toggle="popover"]');
         
         // Los inicializamos uno por uno
         const popoverList = [...popoverTriggerList].map(popoverTriggerEl => new bootstrap.Popover(popoverTriggerEl, {
               html: true,       // Permite usar <br> o <b> dentro del contenido
               trigger: 'hover', // Asegura que funcione al pasar el mouse (o usa 'click')
               container: 'body' // Importante para evitar conflictos de z-index con el mapa
         }));
      });
   </script>
{% endblock scripts %}
